/// Retrieve tickets
/// 
/// Retrieve a ticket by its ID (`ticketId`) or by a unique property (`idProperty`). You can specify what is returned using the `properties` query parameter.
/// 
/// **Parameters:**
/// 
/// - `after: Option<String>`: The paging cursor token of the last successfully read resource will be returned as the `paging.next.after` JSON property of a paged response containing more results.
/// - `archived: Option<bool>`: Whether to return only results that have been archived.
/// - `associations: Option<Vec<String>>`: A comma separated list of object types to retrieve associated IDs for. If any of the specified associations do not exist, they will be ignored.
/// - `limit: Option<i32>`: The maximum number of results to display per page.
/// - `properties: Option<Vec<String>>`: A comma separated list of the properties to be returned in the response. If any of the specified properties are not present on the requested object(s), they will be ignored.
/// - `properties_with_history: Option<Vec<String>>`: A comma separated list of the properties to be returned along with their history of previous values. If any of the specified properties are not present on the requested object(s), they will be ignored. Usage of this parameter will reduce the maximum number of objects that can be read by a single request.
async fn example_basic_get_crm_v_3_objects_tickets_get_page() -> anyhow::Result<()> {
    let client = hubspot_tickets::Client::new_from_env();
    let result: hubspot_tickets::types::CollectionResponseSimplePublicObjectWithAssociationsForwardPaging =
        client
            .basic()
            .get_crm_v_3_objects_tickets_get_page(
                hubspot_tickets::basic::GetCrmV3ObjectsTicketsGetPageParams {
                    after: Some("some-string".to_string()),
                    archived: Some(true),
                    associations: Some(vec!["some-string".to_string()]),
                    limit: Some(4 as i32),
                    properties: Some(vec!["some-string".to_string()]),
                    properties_with_history: Some(vec!["some-string".to_string()]),
                },
            )
            .await?;
    println!("{:?}", result);
    Ok(())
}

/// Create a ticket
/// 
/// Create a single ticket. Include a `properties` object to define [property values](https://developers.hubspot.com/docs/guides/api/crm/properties) for the ticket, along with an `associations` array to define [associations](https://developers.hubspot.com/docs/guides/api/crm/associations/associations-v4) with other CRM records.
async fn example_basic_post_crm_v_3_objects_tickets_create() -> anyhow::Result<()> {
    let client = hubspot_tickets::Client::new_from_env();
    let result: hubspot_tickets::types::SimplePublicObject = client
        .basic()
        .post_crm_v_3_objects_tickets_create(&hubspot_tickets::types::SimplePublicObjectInputForCreate {
            associations: vec![hubspot_tickets::types::PublicAssociationsForObject {
                types: vec![hubspot_tickets::types::AssociationSpec {
                    association_category: hubspot_tickets::types::AssociationCategory::UserDefined,
                    association_type_id: 4 as i32,
                }],
                to: hubspot_tickets::types::PublicObjectId {
                    id: "some-string".to_string(),
                },
            }],
            object_write_trace_id: Some("some-string".to_string()),
            properties: std::collections::HashMap::from([(
                "some-key".to_string(),
                "some-string".to_string(),
            )]),
        })
        .await?;
    println!("{:?}", result);
    Ok(())
}

